Ar lietotni Kadastrs.lv var iegūt informāciju par jebkuru nekustamo īpašumu, zemes vienību, būvi vai telpu grupu (dzīvokli), meklēt esošo vai bijušo adresi, pārlūkot dažādas Valsts zemes dienesta (VZD) rīcībā esošās kartes, saņemt VZD e-pakalpojumus, iegūt informāciju par saviem pasūtījumiem, kā arī sazināties ar klientu konsultāciju centru. Tagad tas ir izdarāms ērtāk un ātrāk! 

Kadastrs.lv mobilajā tālrunī vai planšetdatorā var lejupielādēt bez maksas. 

Lietotne arī palīdzēs neapjukt, ja esat apmaldījies, jo ar GPS palīdzību kartē attēlos jūsu atrašanās vietu. Turklāt ar lietotni var iegūt informāciju par kadastra objektu, kurā lietotājs atrodas. Tā noderēs īpašniekiem, profesionāļiem, VZD klientiem un ikvienam, lai jebkurā laikā un vietā iegūtu datus no Kadastra vai Valsts adrešu reģistra.

Lai izmantotu visas lietotnes iespējas, autorizējieties ar VZD datu publicēšanas un e-pakalpojumu portāla www.kadastrs.lv lietotājvārdu un paroli vai autentificējieties, izmantojot Vienotā valsts un pašvaldību pakalpojumu portāla www.latvija.lv (Latvija.lv) piedāvātās autentifikācijas iespējas (internetbanka, eID).

Izmēģiniet un novērtējiet lietotnes iespējas:
•	meklēt nekustamo īpašumu, zemi, būvi, telpu grupu (dzīvokli), apskatīt tos kartē, pārlūkot pamatinformāciju un papildinformāciju par tiem;
•	kartē izvēlētajā mērogā apskatīt zemes vienību robežas un būvju kontūras, kā arī precīzas adreses;
•	kartē attēlot savu atrašanās vietu, kas noteikta ar ierīces GPS palīdzību*;
•	pārbaudīt adresi;
•	iegūt informāciju par saviem e-pakalpojumiem un pasūtījumiem, kā arī to izpildes statusu;
•	pārlūkot Kadastra datus par saviem nekustamajiem īpašumiem, saņemot e-pakalpojumu „Mani īpašumi”.

VZD turpinās uzlabot lietotnes izmantošanas iespējas. Ja arī Jums ir idejas un ieteikumi, mēs labprāt tos uzklausīsim. 

*Atrašanās vietas noteikšana ir pieejama tikai Latvijas teritorijā.

Mobile application Kadastrs.lv provides an information on any real estate, land parcel, building or premise group (apartment), you can search for current or former address, browse through different maps, owned by the State Land Service, receive the e-services of State Land Service, track your orders and communicate with the Custmer service centre. Now it can be done more convenient and faster.

Kadastrs.lv can be downloaded free of charge on your mobile device.

The application will help you not to get confused in a case if you are lost - the GPS functionality of your device will display your location*. Besides, it provides you with information on the Cadastre object, depending on your location. It will be useful for property owners, professionals, customers of State Land Service and for everyone to obtain data anytime and anywhere from the Cadastre or the State Address Register.

In order to use all the features of the application, please, login with your username and password of the State Land Service data distribution and e-services’ portal www.kadastrs.lv or authenticate using the offered authentication options (Internet banking, eID) of the Single state and local government portal www.latvija.lv (Latvija.lv). 

We encourage you to try and evaluate the options of the application:
•	Search for a real estate, land, building, premise group (apartment), view them on the map, browse the respective basic and additional information.
•	View the boundaries of land parcels and building outlines, as well as accurate addresses on the selected scale of the map;
•	Display your location on the map, determined by your device’s built-in GPS functionality*;
•	Check the address;
•	Obtain an information of your e-services and orders as well as to track their status;
•	Browse Cadastre data of your real estate, receiving e-service “My properties”.

The State Land Service will continue to develop the features of the mobile application. We encourage you to give your feedback and ideas to develop the mobile application.

*Location determination is only  available in territory of Latvia.

